import React from 'react';
import './Dashboard.css';
const Dashboard = () => {
  return (
    <><><div className='dashboard-bg'></div></><Button
      type="submit"
      fullWidth
      variant="contained"
      sx={{ mt: 3, mb: 2, backgroundColor: '#FFCC00', color: '#000000' }} // Set button color to bright yellow
    >
      Sign Up
    </Button></>
  )
}

export default Dashboard
